import React, { useContext } from "react";
import { Link } from "react-router-dom";
import "./Navbar.css";
import { GlobalContext } from "../../context/GlobalState";
import yourImage from "../images/fav.png"; 


const Navbar = () => {
  return (
    
    <div className="navbar">
     
      <Link to="/property">
        <li>Property</li>
        </Link>
        <Link to="/about">
         <li>About Us
          </li>
        </Link>
        <Link to="/contact">
          <li>Contact Us</li>
        </Link>
    </div>
  );
};

export default Navbar;
